import React, { Component } from 'react';
import  { Carousel, CarouselInner, CarouselItem, View, Container } from 'mdbreact';
import './ochain.css'
class Quemsomos extends Component {
  render(){
    return(

<div>
<h1>Quem somos</h1>
<ul>
  <li>Objetivo</li>
  <a>Acabar com a falsificação</a>
  <li>Missão</li>
  <a>Transformar o mundo em um lugar mais justo</a>
  <li>Equipe</li>
  <a>Somo especialistas em tecnologia, com mais de 10 anos no mercado, trazemos nossas experiência para a Ochain.</a>
</ul>
      </div>
    );
  }
}

export default Quemsomos;
